import React, { useState } from "react";

class ClassApp extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            model: "",
            price: 0,
            phones: []
        }
        this.AddPhone = this.AddPhone.bind(this);
    }

    AddPhone() {
        this.setState({phones: this.state.phones.push({model: model, price: price})});
        this.setState({model: this.state.model = ""});
        this.setState({price: this.state.price = 0});
        console.log(this.state.phones);
    }

    render() {
        return (
            <div>
                <div>
                    <input
                        value={this.state.model}
                        onChange={event => this.setState({model: this.state.model = event.target.value})}
                        type="text"
                        placeholder="Phone model"
                    />
                    <input
                        value={this.state.price}
                        onChange={event => this.setState({price: this.state.price = event.target.value})}
                        type="number"
                    />
                    <button onClick={AddPhone}>Add phone</button>
                </div>
                <div>
                    <h3>Phones</h3>
                </div>
            </div>
        )
    }
}

export default ClassApp;
